CREATE TABLE `ppm_prs_project_type_category` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `org_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '组织id,全局的填0',
  `name` varchar(32) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '名称',
  `icon` varchar(8) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT 'icon',
  `object_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '类型,1迭代，2问题',
  `sort` int(11) NOT NULL DEFAULT '1' COMMENT '排序',
  `remark` varchar(512) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '描述',
  `is_readonly` tinyint(4) NOT NULL DEFAULT '2' COMMENT '是否只读,1是 2否',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态,  1可用,2禁用',
  `creator` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updator` bigint(20) NOT NULL DEFAULT '0' COMMENT '更新人',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `version` int(11) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `is_delete` tinyint(4) NOT NULL DEFAULT '2' COMMENT '是否删除,1是,2否',
  PRIMARY KEY (`id`),
  KEY `index_ppm_prs_project_type_category_create_time` (`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

ALTER TABLE `ppm_prs_project_type` ADD COLUMN `cover` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' AFTER `sort`;







